INSERT INTO `article` (`Id`,`Date`,`Title`,`Subtitle`,`Content`,`Published`) VALUES ('85375f26-1f8b-43b2-87d0-444974ccf254','2021-07-23 00:00:00','Migrating to AWS','Moving from self hosting to the cloud','<p>After moving my blog from blogspot to self hosted I am now moving it again. This time to the cloud of AWS. Self hosting was a great learning experience that ended when I was working on IaC and deleted some infrastructure by mistake which took my blog down. After that I did not rebuild the server.</p>\n\n<h5>Elastic Beanstalk setup</h5>\n<p>First, I installed the <a href=\"https://aws.amazon.com/de/visualstudio/\">AWS Toolkit for Visual Studio</a> and authenticated my account so I could deploy my Asp.NET Core application to Elastic Beanstalk. I did not need to change anything in my blog repository for this to work. This product builds my service as a docker image and installs it on at least one EC2 instance. I can choose between a single instance environment or one where an Elastic Loadbalancer (ELB) is installed in front of the EC2 instances. If you have more then one instance you can also choose \"rolling updates\" which allows you to update your application without any downtime. Be aware that the EC2 instances and the ELB will generate cost.</p>\n\n<ul>\n<li><a href=\"https://docs.aws.amazon.com/elasticbeanstalk/latest/dg/dotnet-core-tutorial.html\">Deploying an ASP.NET core application with Elastic Beanstalk</a></li>\n<li><a href=\"https://aws.amazon.com/ec2/pricing\">EC2 Pricing</a></li>\n<li><a href=\"https://aws.amazon.com/elasticloadbalancing\">ELB</a></li>\n</ul>\n\n<img src=\"/api/image/aws_beanstalk_options.jpg\" alt=\"aws elastic beanstalk wizzard\" />\n\n<h5>ElastiCache and data layer</h5>\n<p>After setting up MongoDb and Redis on AWS, which are dependencies of my blog, I quickly learned that the cost of both of those services is too high for a small blog without any traffic. Even if I choose the smallest available instance types the cost will still be too high as both of those services do not support a serverless on demand pricing model. To cut this cost I added a mysql/relational repository layer for my blog and installed a mysql Aurora on demand instance. Then I changed the caching implementation to work if the cache is not reachable so I could just turn it on when demand is high and the application works just without the cache in the other scenario. This allowed me to remove the caching cost completely and reduce the data storage cost drastically.</p>\n\n<ul>\n<li><a href=\"https://aws.amazon.com/elasticache/redis\">ElastiCache Redis</a></li>\n<li><a href=\"https://aws.amazon.com/elasticache/pricing/\">ElastiCache pricing</a></li>\n<li><a href=\"https://aws.amazon.com/documentdb/pricing\">Amazon DocumentDB (with MongoDB compatibility) pricing</a></li>\n</ul>\n\n<h5>Cloudwatch</h5>\n<p>To monitor my application I set up a cloudwatch dashboard and created some alarms for the Elastic Beanstalk environment health. This graph is just measuring the success of the periodic health requests made to the endpoint I defined. Currently this endpoint just returns \"Healthy\" if it is reachable. If the EC2 instance is down, the endpoint is not reachable and the environment health graph will rise. There are 3 applications. \"NtFreXLoggerWeb-prod\" provides an API to log application messages into a central data store. This app has been shutdown in favor of other logging frameworks. \"NtFreXConfigFlowWeb-prod\" provides an API to get configuration values based on a key. This app is currently running, but might be shutdown in favor of other configuration providers. \"NtFreXBlog-prod\" is the application providing the blog web app.</p>\n<img src=\"/api/image/aws_elb_and_beanstalk.jpg\" alt=\"cloudwatch elastic beanstalk and elb\" />\n\n<p>The default configuration creates 3 Redis nodes as visible in the graphs blow.</p>\n<img src=\"/api/image/aws_elasticache.jpg\" alt=\"cloudwatch elasti cache\" />\n\n<p>For the MongoDb there are also 3 instances the graph blow averages them.</p>\n<img src=\"/api/image/aws_mongodb.jpg\" alt=\"cloudwatch mongodb\" />\n\n<p>This Aurora setup is serverless meaning instances are used without my knowledge on demand.</p>\n<img src=\"/api/image/aws_aurora.jpg\" alt=\"cloudwatch aurora\" />\n\n<p>Each website is hosted on one EC2 instance.</p>\n<img src=\"/api/image/aws_ec2.jpg\" alt=\"cloudwatch ec2\" />\n\n<h5>Cost</h5>\n\n<p><b>Required</b></p>\n<pre>\n$0.0058 per On Demand Linux t2.nano Instance Hour\n=> $0.0058 * 24h * 365d = $50.808 / year\n$0.06 per Aurora Capacity Unit hour running Amazon Aurora MySQL Serverless\n=> $0.06 * 24f * 365d = $525.6 / year\n$576.408 / year = Total cost without DataTransfer and dev tools\n</pre>\n\n<p><b>Optional</b></p>\n<pre>\n$0.0225 per Application LoadBalancer-hour (or partial hour)\n=> $0.0225 * 24h * 365d = $197.1 / year\n$0.068 per T2 Medium Cache node-hour (or partial hour) running Redis\n=> $0.068 * 24h * 365d = $595.68 / year\n$792.78 / year = Total optional cost\n</pre>\n\n<p><b>Summary</b></p>\n<pre>\n$1369.188 / year = Total cost if everything would be running\n</pre>\n<p>Realistically I don\'t have the optional cost and do expect the serverless AuroraDb to be running for about 1000 hours per year which would make the total cost $110.808 / year. Things like DataTransfer, tools like VPN, more EC2 instances and others might <i>(will)</i> generate additional cost. There migh be cheaper db models available on AWS and I could use serverless on demand products like lambda to cut more cost for low usage applications. My server I used before cost about $1100 in total which would be amortized after 9.92 years. Though this server does run a lot more than just a website. So this time this page might go down not because I trip over a wire or delete the /bin folder by mistake, but simply because I run out of money.</p>',1);
